import Link from "next/link";
import axios from "axios";

function HomePage(props) {
  return (
    <div>
      <Link href="/">
        <a> Home </a>
      </Link>
      <Link href="/about">
        <a> About </a>
      </Link>
      {
        [1,2,3].map(val => {
          <div> val </div>
        })
      } 
    </div>
  );
}

HomePage.getInitialProps = async () => {
  const res = await axios.get("https://binance-api-example.herokuapp.com/");
  const data = res.data;
  return { pages: data };
};

export default HomePage;
